import React from 'react';
import Field from "./Field"
import {Link} from 'react-router-dom';

class Login extends React.Component{
    
    constructor(props){
        super(props);
        this.handleUserInsertion = this.handleUserInsertion.bind(this);
        this.handlePasswordInsertion = this.handlePasswordInsertion.bind(this);
    }

    render(){
        return (<div className='login'>
         <Field remark="userName"  content={this.handleUserInsertion} />
            <Field remark="password"  content={this.handlePasswordInsertion} />
            <div className="button_cont" align="center">
     <Link class="example_f" to='Register' >
     <span>Login</span></Link></div>
        </div>)

    }
}

export default Login;
